import React from 'react'
import './topbar.css'

export default function TopBar() {
  return (
    <div className='top'>
        <div className="topLeft">
        <i class="fa-brands fa-facebook-f"></i>
        </div>
        <div className="topCenter"></div>
        <div className="topRight"></div>
    </div>
  )
}
